import "./First.css";
import image from "./image-transform.jpg";
import { Container } from 'react-bootstrap';
const First = () => {
  return (
    <div>
      <Container fluid >
        <div className="row" >
            <div className='sec1 col-12 col-sm-6 '>
              <h2 className="">Transform your <br/>brand</h2>
              <p className="my-5">
                We are a full-service creative agency<br/> specializing in helping
                brands grow fast.<br/> Engage your clients through compelling<br/> visuals
                that do most of the marketing for you.
            </p>
            <a href="#" className="learnmore">Learn more</a>
            </div>

        </div>
      </Container>
    </div>
  );
};

export default First;
